" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 656px\">",
"   <div class=\"ttl\">",
"    Comparing child and parent head circumference",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 636px; height: 812px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    It is helpful to simultaneously plot the child's and parents' occipitofrontal circumference (OFC) measurements to compare the percentile or standard deviation. For most normal children, the child's OFC percentile is between that of the parents. In the example above, the child's OFC is certainly small relative to that of his parents.",
